import React from 'react';
import {Grid, Row, Col} from "react-native-easy-grid";
import { StyleSheet, ScrollView, Text, View} from 'react-native';
import styled from 'styled-components/native';
import { Button } from 'react-native-elements';
import {moderateScale} from "../styles/globalstyles";
import DashboardScreen from "../screens/Dashboard/DashboardScreen";

export default function AddMealHeader(){

    return(

            <Row size={1} style={headerStyle.rowStyle}>
                <Button  type="outline"
                         title={"Zurück"}
                         onPress={ (navigation) => navigation={DashboardScreen}}
                />
                <Button  type="outline"
                         title={"Mahlzeit erstellen"}
                 />
            </Row>

    )
}

const headerStyle = StyleSheet.create({
    rowStyle: {
        display: 'flex',
        justifyContent: 'space-between',
        marginLeft: moderateScale(10, 0.5),
        marginRight: moderateScale(10, 0.5),
    },
})
